import react from "react";

export default class Greet extends react.Component {
  render(){
    return react.createElement(
      "div",
      null,
      react.createElement(
        "h1",
        { className: "hello", style: { color: "red" } },
        {}
      ),
      react.createElement(
        "h1",
        { className: "hello", style: { color: "red" } },
        "hello with create element 2"
      )
    );
  }

}
